import { HttpClient } from '@angular/common/http';
import { Observable, lastValueFrom } from 'rxjs';
import { IonModal } from '@ionic/angular';
import { OverlayEventDetail } from '@ionic/core/components';
import { Component, ViewChild } from '@angular/core';
import {
  Filesystem,
  Directory,
  Encoding,
  WriteFileOptions,
} from '@capacitor/filesystem';

@Component({
  selector: 'app-home',
  templateUrl: 'home.page.html',
  styleUrls: ['home.page.scss'],
})
export class HomePage {
  pdfSrc = 'https://vadimdez.github.io/ng2-pdf-viewer/assets/pdf-test.pdf';
  zoom = 1;

  constructor(private http: HttpClient) {}

  async onDowload() {
    try {
      this.status = 'warning';

      const res = await lastValueFrom(this.getFile(this.pdfSrc));

      const base64 = this.arrayBufferToBase64(await res.arrayBuffer());

      const date = new Date().toISOString();
      const date2 = date.replace(/-/g, '').replace(/:/g, '').replace(/\./g, '').replace(/T/g, '');


      await Filesystem.writeFile({
        path: `${date2}.pdf`,
        data: base64,
        directory: Directory.Documents,
      })
        .then( async (res) => {
          this.status = 'success';
          this.icon = 'checkmark';
          this.message = { success: JSON.stringify(res) };
        })
        .catch((error) => {
          this.status = 'danger';
          this.icon = 'warning';
          this.message = { error: JSON.stringify(error) };
        });
    } catch (error) {
      console.log(error);
    }

    // setTimeout(() => {
    //   this.status = 'primary';
    //   this.icon = 'information';
    // }, 3000);
  }

  getFile(url: string): Observable<Blob> {
    return this.http.get(url, { responseType: 'blob' });
  }

  arrayBufferToBase64(buffer: ArrayBuffer): string {
    let binary = '';
    const bytes = new Uint8Array(buffer);
    for (let i = 0; i < bytes.byteLength; i++) {
      binary += String.fromCharCode(bytes[i]);
    }
    return btoa(binary);
  }

  /* %%%%%%%%%%%%%%%%%%%%%% MODAL ALERT %%%%%%%%%%%%%%%%%%%%%% */
  /* %%%%%%%%%%%%%%%%%%%%%% MODAL ALERT %%%%%%%%%%%%%%%%%%%%%% */
  /* %%%%%%%%%%%%%%%%%%%%%% MODAL ALERT %%%%%%%%%%%%%%%%%%%%%% */

  status: 'danger' | 'success' | 'warning' | 'primary' = 'primary';
  icon: 'checkmark' | 'warning' | 'information' = 'information';
  message: any;
  @ViewChild(IonModal) modal: IonModal;

  onWillDismiss(event: Event) {
    const ev = event as CustomEvent<OverlayEventDetail<string>>;
    if (ev.detail.role === 'confirm') {
      console.log('Confirm', ev.detail.data);
    }
  }
  cancel() {
    this.modal.dismiss(null, 'cancel');
  }

  confirm() {
    this.modal.dismiss('text', 'confirm');
  }

  /* %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%% */

  subtratZoom() {
    if (this.zoom > 0.5) {
      this.zoom -= 0.3;
    }
  }
  addZoom() {
    if (this.zoom < 2) {
      this.zoom += 0.3;
    }
  }
}

